import React from 'react';
import "./partner.scss"
import PartElem from "./part_elem";
const Partners = () => {
    return (
        <div className="main_cont">
            <div className="main_cont1">
                <div className="main_cont2">
                    <PartElem/>
                    <PartElem/>
                    <PartElem/>
                    <PartElem/>
                </div>
            </div>
        </div>
    );
};

export default Partners;
